import React from 'react';
// Styles
import { InfoStyles } from './Info.styles';

const Info = () => (
  <InfoStyles>
    <p>
      洞察者號(InSight)測量火星表明Elysium平原(火星赤道)的天氣,包括氣溫,風向,氣壓等科研數據.有一天人類需要殖民火星...
    </p>
    <p>
      這些氣候數據只是探測任務的一部分
      <a href='https://mars.nasa.gov/insight/mission/overview/'>Click here</a>
      to find out more.
    </p>
  </InfoStyles>
);

export default Info;
